import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router,
Route } from 'react-router-dom'
import HomePage from  './pages/HomePage'

function App() {
  return (
    <Route>
      <div className="App">
        <Route path="/" component={HomePage} exact/>
      </div>
    </Route>
  );
}

export default App;
